import React,{useContext} from "react";
import "../styles/Home.css";
import Destination from './Destination'
import { SendAlert } from "./Destination";
import Passengercount from "./Passengercount";
import flightContent from "../context/FlightContext";
import Tripcategory from "./Tripcategory";
import Tripdates from "./Tripdates";
import { useNavigate } from "react-router-dom";
import Alert from './Alert';
const Home = () => {
    var navigate = useNavigate()
    const content = useContext(flightContent)
    const { getFlights, departure, arrival, departDate, setSearch} = content 

    const SearchFlights = () => {
      if(departDate){
        setSearch('true')
      }
      getFlights(departure,arrival,departDate)
      navigate('/search')
    }

  return (
    <>
    <div className="search-flights-con">
      <form className="search-flights-form">
        <div className="f-q-container  d-flex">
          <Destination/>
          <Tripcategory/>
          <Tripdates/>
          <Passengercount/>
        </div>
        <div className="s-b-con">
          {<Alert error={SendAlert}/>}
          <button type="button" onClick={SearchFlights}className="search-flights-btn">Search Flights</button>
        </div>
      </form>
    </div>
    </>
  );
};

export default Home;
